import React from 'react'
import './sass/navbar.css';
import logo from '../component/images/logo.svg';

 class Navbar extends React.Component {
    render() {
        return (
            <>
            <nav className="navbar">
                <div className="logo">
                    <img src={logo}></img>
                </div>
            </nav>
            </>
        )
    }
}

export default Navbar;
